import React from 'react';
import { Link } from 'react-router-dom';
import { FiHome, FiFileText, FiSettings, FiInfo } from 'react-icons/fi';

const Overview = () => {
  const recentActivity = [
    { id: 1, type: 'property', action: 'added', title: 'Modern Apartment in Bole', time: '2 hours ago' },
    { id: 2, type: 'message', action: 'received', title: 'New message from John', time: '5 hours ago' },
    { id: 3, type: 'view', action: 'received', title: 'Your property was viewed 15 times', time: '1 day ago' },
    { id: 4, type: 'favorite', action: 'added', title: 'Your property was added to favorites', time: '2 days ago' },
  ];

  const quickActions = [
    { 
      title: 'Post a Property', 
      description: 'List a new property for sale or rent',
      icon: FiHome,
      path: '/dashboard/create-property',
      color: 'bg-blue-100 text-blue-600'
    },
    { 
      title: 'View My Listings', 
      description: 'Manage your property listings',
      icon: FiFileText,
      path: '/dashboard/my-listings',
      color: 'bg-green-100 text-green-600'
    },
    { 
      title: 'Account Settings', 
      description: 'Update your profile and preferences',
      icon: FiSettings,
      path: '/dashboard/settings',
      color: 'bg-purple-100 text-purple-600'
    },
    { 
      title: 'Help & Support', 
      description: 'Get help with using the platform',
      icon: FiInfo,
      path: '/help',
      color: 'bg-yellow-100 text-yellow-600'
    }
  ];

  return (
    <div className="space-y-6">
      <div className="flex items-center justify-between">
        <h2 className="text-2xl font-bold text-gray-900">Dashboard Overview</h2>
      </div>

      {/* Quick Actions */}
      <div className="mt-8">
        <h3 className="text-lg font-medium text-gray-900">Quick Actions</h3>
        <div className="grid grid-cols-1 gap-6 mt-4 sm:grid-cols-2 lg:grid-cols-4">
          {quickActions.map((action, index) => (
            <Link
              key={index}
              to={action.path}
              className="p-6 transition-all duration-200 bg-white rounded-lg shadow hover:shadow-md"
            >
              <div className={`inline-flex items-center justify-center w-12 h-12 rounded-full ${action.color} mb-4`}>
                <action.icon className="w-6 h-6" />
              </div>
              <h4 className="text-lg font-semibold text-gray-900">{action.title}</h4>
              <p className="mt-1 text-sm text-gray-500">{action.description}</p>
            </Link>
          ))}
        </div>
      </div>

      {/* Recent Activity */}
      <div className="mt-8">
        <h3 className="text-lg font-medium text-gray-900">Recent Activity</h3>
        <div className="mt-4 overflow-hidden bg-white shadow sm:rounded-lg">
          <ul className="divide-y divide-gray-200">
            {recentActivity.map((activity) => (
              <li key={activity.id} className="px-4 py-4 sm:px-6 hover:bg-gray-50">
                <div className="flex items-center justify-between">
                  <p className="text-sm font-medium text-gray-900">
                    {activity.title}
                  </p>
                  <p className="text-sm text-gray-500">
                    {activity.time}
                  </p>
                </div>
              </li>
            ))}
          </ul>
          <div className="px-4 py-4 text-sm border-t border-gray-200 sm:px-6">
            <Link to="/dashboard/activity" className="font-medium text-blue-600 hover:text-blue-500">
              View all activity<span aria-hidden="true"> &rarr;</span>
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Overview;
